import React, { useState } from "react";
import "./ProductSection.css"; // Assuming you have styles in this file

const products = {
  featured: [
    { id: 1, name: "Necklace", image: "/images/product/1.jpg", price: "₹44015" },
    { id: 2, name: "Earrings", image: "/images/product/2.jpg", price: "₹45015" },
  ],
  arrivals: [
    { id: 13, name: "Bracelet", image: "/images/product/13.jpg", price: "₹74015" },
    { id: 14, name: "Bangles", image: "/images/product/14.jpg", price: "₹64015" },
  ],
  onsale: [
    { id: 25, name: "Ring", image: "/images/product/25.jpg", price: "₹54015" },
    { id: 26, name: "Diamonds", image: "/images/product/26.jpg", price: "₹94015" },
  ],
};

const ProductSection = () => {
  const [modalProduct, setModalProduct] = useState(null);

  const handleQuickView = (product) => {
    setModalProduct(product);
  };

  return (
    <section className="product-section">
      <div className="container">
        <h2>Our Collection</h2>

        <ul className="nav nav-tabs">
          <li className="nav-item">
            <a className="nav-link active" data-bs-toggle="tab" href="#featured">
              Featured
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" data-bs-toggle="tab" href="#arrivals">
              New Arrivals
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" data-bs-toggle="tab" href="#onsale">
              On Sale
            </a>
          </li>
        </ul>

        <div className="tab-content mt-4">
          {["featured", "arrivals", "onsale"].map((category) => (
            <div
              key={category}
              className={`tab-pane fade ${category === "featured" ? "show active" : ""}`}
              id={category}
            >
              <div className="product-grid">
                {products[category].map((product) => (
                  <div key={product.id} className="product-card">
                    <div className="image-container">
                      <img src={product.image} alt={product.name} />
                      <div className="hover-info">
                        <h3>{product.name}</h3>
                        <p className="price">{product.price}</p>
                        <div className="rating">
                          <span>★ ★ ★ ★ ☆</span> {/* Static 4-star rating */}
                        </div>
                        <button
                          className="quick-view-btn"
                          onClick={() => handleQuickView(product)}
                        >
                          Quick View
                        </button>
                        <button className="add-to-cart-btn">Add to Cart</button>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {modalProduct && (
          <div className="modal fade show d-block" style={{ backgroundColor: "rgba(0, 0, 0, 0.5)" }}>
            <div className="modal-dialog">
              <div className="modal-content">
                <div className="modal-header">
                  <h5 className="modal-title">{modalProduct.name}</h5>
                  <button
                    type="button"
                    className="btn-close"
                    onClick={() => setModalProduct(null)}
                  ></button>
                </div>
                <div className="modal-body">
                  <img src={modalProduct.image} alt={modalProduct.name} className="img-fluid" />
                  <p>{modalProduct.price}</p>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default ProductSection;
